import styled from "styled-components";

export default styled.div`
  display: flex;
//   justify-content: center;
  align-items: center;
  height: 200px;
  width: 80%;
  background-color: white;
  color: #fff;
  margin: 15px;
  font-size: 4em;
  border-radius: 20px;
  justify-content: flex-start;
`;
